					zip.putNextEntry(mappingEntry);
					zip.write(MAPPING_TEMPLATE.create(obj, modelId).getBytes());
					zip.closeEntry();
				}
			} catch (Exception ex) {
				ex.printStackTrace();
			} finally {
				if (zip!= null) {
					zip.close();
				}
			}

			return baos.toByteArray();
		} catch (Exception e) {
			throw new RuntimeException(e);
		} finally {
			if (baos!= null) {
				try {
					baos.close();
				} catch (IOException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
		}
